import { useState } from "react";
export default function App() {
  let [number, setNumber] = useState(0);
  console.log(useState);

  const clickHandler = () => {
    setNumber(number + 1);
  };

  return (
    <>
      <h1>{number}</h1>
      <button onClick={clickHandler}>click</button>
    </>
  );
}
